import React, { useState } from 'react';
import { Box, Typography, IconButton, InputBase, Menu, MenuItem } from '@mui/material';
import FavoriteIcon from '@mui/icons-material/Favorite';
import ImageIcon from '@mui/icons-material/Image';
import ArrowUpwardIcon from '@mui/icons-material/ArrowUpward';
import ArrowDropDownIcon from '@mui/icons-material/ArrowDropDown';

function Gallery() {
  const [selected, setSelected] = useState('');
  const [anchorEl, setAnchorEl] = useState(null);

  const handleSelect = (name) => {
    setSelected(name);
  };

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  return (
    <Box 
      sx={{
        width: '1000px',
        height: '60px',
        backgroundColor: '#ffffff',
        borderRadius: '30px',
        border: '1px solid lightgray',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'space-between',
        padding: '0 20px',
        boxShadow: 2,
        margin: '20px auto',
      }}
    >
      {/* Left Section */}
      <Box sx={{ display: 'flex', alignItems: 'center', gap: '20px' }}>
        <IconButton
          onClick={() => handleSelect('محبوب ها')}
          sx={{
            border: selected === 'محبوب ها' ? '3px solid green' : 'none',
            borderRadius: '50%',
          }}
        >
          <FavoriteIcon color={selected === 'محبوب ها' ? 'success' : 'inherit'} />
        </IconButton>
        <Typography>محبوب ها</Typography>

        <IconButton
          onClick={() => handleSelect('تازه ها')}
          sx={{
            border: selected === 'تازه ها' ? '3px solid green' : 'none',
            borderRadius: '50%',
          }}
        >
          <ImageIcon color={selected === 'تازه ها' ? 'success' : 'inherit'} />
        </IconButton>
        <Typography>تازه ها</Typography>

        <IconButton
          onClick={() => handleSelect('در حال پیشرفت')}
          sx={{
            border: selected === 'در حال پیشرفت' ? '3px solid green' : 'none',
            borderRadius: '50%',
          }}
        >
          <ArrowUpwardIcon color={selected === 'در حال پیشرفت' ? 'success' : 'inherit'} />
        </IconButton>
        <Typography>در حال پیشرفت</Typography>
      </Box>

      {/* Right Section */}
      <Box sx={{ display: 'flex', alignItems: 'center', gap: '10px' }}>
        <InputBase
          placeholder="دسته‌بندی‌ها"
          sx={{
            border: '1px solid lightgray',
            borderRadius: '30px',
            padding: '5px 10px',
          }}
        />
        <IconButton onClick={handleMenuOpen}>
          <ArrowDropDownIcon />
        </IconButton>
      </Box>

      {/* Dropdown Menu */}
      <Menu
        anchorEl={anchorEl}
        open={Boolean(anchorEl)}
        onClose={handleMenuClose}
        sx={{ mt: 1 }}
      >
        <MenuItem onClick={handleMenuClose}>طبیعت</MenuItem>
        <MenuItem onClick={handleMenuClose}>چشم‌اندازها و مناظر</MenuItem>
        <MenuItem onClick={handleMenuClose}>حیات وحش</MenuItem>
        <MenuItem onClick={handleMenuClose}>معماری</MenuItem>
        <MenuItem onClick={handleMenuClose}>هوایی</MenuItem>
        <MenuItem onClick={handleMenuClose}>اشیا و طبیعت بی‌جان</MenuItem>
        <MenuItem onClick={handleMenuClose}>نجومی</MenuItem>
        <MenuItem onClick={handleMenuClose}>شب</MenuItem>
        <MenuItem onClick={handleMenuClose}>سیاه و سفید</MenuItem>
        <MenuItem onClick={handleMenuClose}>پرتره</MenuItem>
        <MenuItem onClick={handleMenuClose}>ماکرو</MenuItem>
        <MenuItem onClick={handleMenuClose}>خبری، ورزشی و مستند</MenuItem>
      </Menu>
    </Box>
  );
}

export default Gallery;
